import React from 'react';
import { Typography, Checkbox } from 'antd';

const { Title, Text } = Typography;

export default class SideNav extends React.Component {
    state = {
        categories: [
            { label: 'T-shirt', value: 'T-shirt' },
            { label: 'Lounge T-shirt', value: 'Lounge T-shir' },
        ],
        brand: [
            { label: 'Roadstar', value: 'Roadstar' },
            { label: 'WROGN', value: 'WROGN' },
            { label: 'Puma', value: 'Puma' },
            { label: 'max', value: 'max' },
            { label: 'Dressbery', value: 'Dressbery' },
            { label: 'HRX', value: 'HRX' },
        ],
        price: [
            { label: 'Rs. 115 to Rs. 2336(63944)', value: 'Rs. 115 to Rs. 2336(63944)' },
            { label: 'Rs. 2336 to Rs. 4557(2168)', value: 'Rs. 2336 to Rs. 4557(2168)' },
            { label: 'Rs. 4557 to Rs. 6778(129)', value: 'Rs. 4557 to Rs. 6778(129)' },
            { label: '6778 to Rs. 8999(24)', value: '6778 to Rs. 8999(24)' },
        ],
        color: [
            { label: 'Black', value: 'Black' },
            { label: 'White', value: 'White' },
            { label: 'Blue', value: 'Blue' },
            { label: 'Red', value: 'Red' },
            { label: 'pink', value: 'Pink' },
            { label: 'Yellow', value: 'Yellow' },
        ]
    }

    onChangeCategories = () => {

    }

    onChangeBrand = () => {

    }

    onChangePrice = () => {

    }

    onChangeColor = () => {

    }

    render() {
        const { categories, brand, price, color } = this.state
        return (
            <>
                <div className="side-nav-container">
                    <Title level={5}>CATEGORIES</Title>
                    <Checkbox.Group options={categories} onChange={this.onChangeCategories} />
                    <Title level={5}>BRAND</Title>
                    <Checkbox.Group options={brand} onChange={this.onChangeBrand} />
                    <Title level={5}>PRICE</Title>
                    <Checkbox.Group options={price} onChange={this.onChangePrice} />
                    <Title level={5}>COLOR</Title>
                    <Checkbox.Group options={color} onChange={this.onChangeColor} />
                </div>
            </>
        )
    }
}
